import React, { useEffect, useState } from 'react';



const Home = () => {
    const { state, setState } = useState([]);

    useEffect(() => {
        setState([
            {
                name: "Nice Bunglow",
                type: "Bunglow",

            }
        ]);
    })

    return (
        <div className="container bg-light p-3 pt-5">
            Home Page
        </div>
    );
}

export default Home;
